import React from "react";

import BlenderPhoto from './img/blender_logo_02.png';
import YoutubePhoto from './img/youtube_logo.png';

import './css/Hobby.css';

class Hobby extends React.Component {

  render() {
    return(
      <div className='WideSection'>
        <div>
          <strong className="Titles MainTitle">Hobby</strong>
        </div>
        <div>
          <p>
          Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec quis nibh at felis congue commodo. Nullam sit amet magna in magna gravida vehicula. Nulla est. Mauris dictum facilisis augue. Duis risus. Nulla accumsan, elit sit amet varius semper, nulla mauris mollis quam, tempor.
          </p>
        </div>
        <div>
          <div className="ImgSection">
            <img src={BlenderPhoto} alt="Logo" className="BlenderImg" />
          </div>
          <div>
            pictures
          </div>
        </div>
        <div>
          <div className="ImgSection">
            <img src={YoutubePhoto} alt="Logo" className="YoutubeImg" />
          </div>
          <div>
            pictures
          </div>
        </div>
      </div>
    );
  }
}

export default Hobby;
